When you execute code in between parentheses, execute code from a single line, or execute an entire file, that's a block. The final expression in a block is its return value. When you execute a block in the IDE, the post window prints out the block's return value, preceded by a ->. (
1;
2;
3;
)
// -> 3 You can declare local variables using var. They're lexically scoped, so they behave similarly to a lot of your favorite languages. (
var foo = 3, bar;
var baz = 50, quux = foo + baz;
quux;
)
// -> 53 All var statements have to go at the top of the block, and can't be interspersed with other code. (I know, it sucks.) An unassigned variable is given a value of nil. A variable name always starts with a lowercase Latin letter, then any number of characters in a-z A-Z 0-9 _. The reserved keywords are quite few: var arg classvar const pi true false nil inf These identifiers are valid variable names, but I wouldn't recommend them, because then you won't have access to the actual builtins in the local scope: this super thisProcess thisFunction thisFunctionDef thisMethod thisThread
currentEnvironment topEnvironment Assigning to variables outside of var statements is done in the regular C way, like foo = 3;. Assignments return the assigned value, so they may be chained (foo = bar = 3). Operators like += are not supported in the spirit of minimalist Smalltalk syntax. Variables are scoped to the block they are in, and they cease to exist outside of the block. How do we share information between blocks then?

