sclang doesn't have global variables. Instead, sclang has a syntactic feature known as "environment variables" (not to be confused with the OS-level environment variables like PATH) that provides a substitute for global scope. These are notated with the ~ prefix. In casual conversation, SC users often refer to them as "tilde variables." ~foo = 3;
~foo // -> 3 These variables persist across blocks. However, what they really supply is dynamic scoping . They are setting and getting key-value data in a global value called currentEnvironment, which can be manipulated and changed using various instance and class methods of Environment. Some people like to use exclusively environment variables to get out of typing var. I don't recommend it. Local variables have garbage collection and are less prone to mistakes (for example, a typo'd local variable results in a syntax error, while a typo'd tilde variable returns nil). Only use environment variables when information needs to be passed between interactively executed blocks. I lied — sclang does actually have global variables, but it has exactly 26 of them: the letters a through z. x = 3;
x // -> 3 I strongly advise against using these in any production code. They're okay when you're doing nonserious tests, but please don't use them in real compositions. Note that a single-letter variable declared locally (e.g. var x) isn't global, and just behaves like any other local variable.

