In sclang, pretty much every useful operation is performed by doing method calls on objects. The object we're calling on is referred to as the receiver , and it can take any number of arguments. The following are the most common syntaxes for method calls: receiver.doSomething(1, 2, 3);
doSomething(receiver, 1, 2, 3); The second one looks like a function call, but it's not. doSomething is actually a method name, and not referring to any variable in the local scope. Method calls may take keyword arguments: receiver.doSomething(foo: 1, bar: 2, baz: 3); If no arguments are provided, the parentheses may be omitted (as they conventionally are): "Hello World".postln();
"Hello World".postln; Users coming from JavaScript, Python, or C++ may be used to . being for attribute retrieval in addition to method calls. In sclang, attribute getters are just method calls.

