Boolean operators in sclang are a little different from other languages. (0 == 1).not // -> false // Equivalent:
true.and(false)
true and: false // The second is known as "key binary operator" syntax, and can be used in the
// special case where only one argument is passed to the method. // 'and' and 'or' require their second argument to be wrapped in a function
// for short circuiting to occur:
doThisThing.() or: { doThatThing.() } In keeping with sclang's minimal syntax, control structures are just method calls involving functions. (
if(2 + 2 == 4, { "Nice!".postln;
}, { "What?".postln;
});
) // Shortcut syntax that may be used because all arguments are functions. (
if(2 + 2 == 4) { "Nice!".postln;
} { "What?".postln;
};
) // 'if' produces a return value from the function/block that was run, so it
// actually doubles as a ternary operator.
if(2 + 2 == 4, { "Nice" }, { "What" }).postln; // 'case' is a quick way to write a bunch of nested 'if's. The first condition
// that's true is evaluated.
case { x < 0 } { "It's negative".postln; } { x > 1000 } { "It's nonnegative, but too big".postln; } { x % 2 == 0 } { "It's an even number".postln; }; // 'switch' is very similar to ordinary switch statements. Like 'if' and
// 'case', it passes along the return value of the function that was actually
// evaluated.
switch(thing, \option1, { "Option 1" }, \option2, { "Option 2" }
).postln; // You can wrap the values in functions — saves a few commas.
switch(thing) { \option1 } { "Option 1".postln } { \option2 } { "Option 2".postln }; sclang is strict about only Booleans being placed in if, not, and, and or. If you try something like if(0, ...), you will receive an error that says "Non Boolean in test." if, switch, and case are not keywords. They are methods.

