Creation, getting, and setting are the usual. Zero-indexed. (
var myArray = [1, 3, 4, 4, 3];
myArray[0] = myArray[3];
myArray[1] = "hey";
"Array size is %".format(myArray.size).postln;
myArray;
)
// Array size is 5
// -> [ 4, hey, 4, 4, 3 ] // NOTE: getting and setting indices are actually syntactic sugar for the ".at"
// and ".put" methods. Retrieving an out-of-bounds index returns nil. Setting an out-of-bounds index produces an error. Here are a few useful ways to create arrays: (0..4) // -> [ 0, 1, 2, 3, 4 ], inclusive of both endpoints
(1,3..10) // -> [ 1, 3, 5, 7, 9 ]
4.dup(8) // -> [ 4, 4, 4, 4, 4, 4, 4, 4 ]
{ |i| i ** 2 }.dup(8) // -> [ 0, 1, 4, 9, 16, 25, 36, 49 ] sclang supports multichannel expansion. Binary and unary operators, when applied to arrays, are broadcast to the array's elements: [1, 2, 3, 4] + 4 // -> [ 5, 6, 7, 8 ]
[3, 4, 5] * [1, 6, 8] // -> [ 3, 24, 40 ] This sounds small, but it becomes unbelievably convenient when working with multichannel sound design. Appending to arrays is done using the .add method. However, for efficiency .add may or may not be in place . To avoid unexpected behavior, always assign the return value of .add back to the slot for the original array: (
var myArray = [1, 2, 3];
myArray = myArray.add(4);
)
// -> [1, 2, 3, 4] Slices are denoted with .. and are inclusive of both indices: (
var myArray = [1, 5, 2, 0, 4, 4];
myArray[2..4]
)
// -> [ 2, 0, 4 ] The following tools are also useful — I am certain you can figure out how they work from their names and very brief examples, and if not, you can consult the documentation: ["con", "cat"] ++ ["en", "a", "tion"]
newArray = array.copy
array.indexOf(thing)
array.includes(thing)
["heads", "tails"].choose
array.scramble

