sclang has a rich variety of methods for iterating and filtering arrays. Here is a very terse summary of them. // Prints numbers 0 through 7 inclusive.
8.do { |i| "i".postln; }; // Remember, 8.do { ... } is just shorthand for 8.do({ ... }). // Do something for each element. index is optional.
array.do { |elem| ... };
array.do { |elem, index| ... }; // Do something for each element and make a new array from the return values.
// Often called "map" in other environments
var newArray = array.collect { |elem| ... }; // Filter the array and keep only elements for which the given function returns
// true. The function should only return Booleans.
var newArray = array.select { |elem| elem % 2 == 0 }; // Return true iff the function returns true for any/every element.
// The function should only return Booleans.
[1, 2, 3].any { |elem| elem % 2 == 0 }
[1, 2, 3].every { |elem| elem % 2 == 0 } These methods don't lazy evaluate on arrays, so chaining them isn't efficient like in functional programming environments. SC does have native coroutines via the Routine class. Array methods get the job done most of the time, but while loops are also sometimes necessary: var x = 3;
while { x < 10 } { x.postln; x = x + 1;
}; // More idiomatic: (3..9).do { |x| x.postln } Loops can be broken out of using the block method, which is exceedingly rare but occasionally the best option: block { |break| 5.do { |i| if(i > 3) { break.value("hey"); // "hey" is the return value of block { ... } }; };
};
